import React from "react";
import { Link } from "react-router-dom";

function EAFnavi() {
  return (
    <>
      <Link to="/eventTable">
        <button>이벤트 테이블</button>
      </Link>
      <Link to="/login">
        <button>축제 테이블</button>
      </Link>

    </>
  );
}

export default EAFnavi;
